import { technologies } from "../Data/technologies";
import js from '../logos/JS.png';
import python from '../logos/python.png';
import html from '../logos/html.png';
import css from '../logos/css.png';
import sass from '../logos/sass.png';
import bootstrap from '../logos/bootstrap.png';
import react from '../logos/react.png';
import node from '../logos/node.png';
import git from '../logos/git.png';
import linux from '../logos/linux.png';

function Tech() {
  const images = require.context('../logos', true);
  console.log(images);
  const list = technologies.map((tech) => {
    let sourceImg = require('../logos' + tech.id + '.png');
    return (
      <li key={tech.name}>
        <img width='50' src={sourceImg}></img>
        <h5 >{tech.name}</h5>
      </li>
    );
  });
  console.log(list);
  return (
    <div>
      <h3>Technologies</h3>
      <ul>{list}</ul>
    </div>
  );
}

export default Tech;
